@LittlePopRock @GobCDMX @SSaludCdMx Segundo Refuerzo o cuarta dosis solamente a grupos vulnerables.

Mayores de 60 años, con o sin enfermedades.

De 18 a 59 años demostrando que tienen una enfermedad cormobil.

@BChanclitos @SSaludCdMx Y el segundo Refuerzo o cuarta dosis solamente para grupos vulnerables.

Todos los adultos mayores de 60 años.

Y de 18 a 59 años, solamente demostrando que tienen una enfermedad cormobil.

@f_neyc @SSaludCdMx El segundo Refuerzo o cuarta dosis para la mayoría solo aplica para personas con más de 60 años.

Y de 18 a 59 años, demostrando que tienen una enfermedad cormobil.

Si pertenece a uno de estos grupos, puede acudir a vacunarse.

@MariadeJessJur2 @EduardoClark 1. No es refuerzo es segunda dosis. El refuerzo es la tercera dosis.

2 Puede ser aplicada hasta dos meses después de la primera.

3 No hay fecha programada.

@edgar_reysg @EduardoClark 1 No es Refuerzo, es según dosis. El refuerzo sería el equivalente a una tercera dosis.

2 Se puede aplicar hasta 2 meses después.

3 No hay fecha programada.

@Jumelk_dragon @GobCDMX @SSaludCdMx @LaAgenciaCDMX @locatel_mx Lamentablemente en México, la cuarta dosis o segundo Refuerzo solo se aplicará a grupos vulnerables.

Mayores de 60 años.  Todos.

Y de 18 a 59 años, solamente las personas que tengan una enfermedad cormobil.

@PedroGAvalos @SSaludCdMx Cansino es el equivalente a 2 dosis de Astra Sputnik y Pfaizer.

Más moderna usted ya tiene el equivalente a 3 dosis.

El segundo Refuerzo o cuarta dosis, solamente para mayores de 60 años. Y de 18 a 59 años, demostrando que tienen una enfermedad cormobil.

@Beatriz11073963 @SSaludCdMx El segundo Refuerzo o cuarta dosis se aplica únicamente  para grupos vulnerables.

* Todos los adultos mayores de 60 años, con o sin enfermedades cormobiles.

* De 18 a 59 años, solamente demostrando que tienen una enfermedad cormobil.

