El equivalente a tres dosis. 

Un segundo Refuerzo solo está autorizada para mayores de 60 años y personas que demuestren que tienen una enfermedad cormobil. Por lo que ya tiene todas.

@miri_carrillo @SSaludCdMx No, ya que ya tienen el esquema completo.

Un segundo Refuerzo, Terra dosis en su caso, cuarta dosis para los demás. Solamente para grupos vulnerables.

Personas mayores de 60 años. Y de 18 a 59 años, solamente para personas con alguna enfermedad cormobil.

@AbeejaLovesYou @Claudiashein Los maestros ya tienen vacuna y Refuerzo. Cansino equivale a 2 Dosis de Astra, Pfaizer y Sputnik. Más la vacuna de refuerzo 

