Por lo que Cansino más la vacuna de refuerzo que ya tiene . Es igual a las tres dosis que tienen los demás.

Por lo tanto si esquema está completo.

@AidilSacsey @EduardoClark Refuerzo = tercera dosis.
Refuerzo adicional o Segundo Refuerzo = Cuarta dosis.

Por lo que el anuncio al de decir refuerzo, significan que están aplicando la tercera dosis.

